function Navbar() {
    return (
        <>
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <div className="container-fluid">
                    <div className="navbar-brand">
                    <img src={require("../picture/Logo.png")} alt="" width="50%" height="50%" 
                    style={{ju}}/></div>
                </div>
            </nav>
        </>
    )
}

export default Navbar;
